import React, { useEffect, useState } from 'react';
import { connect } from "react-redux";
import ApiRequest from '../../services/api/Api-request';
import { Videos } from '../video/Videos';


const Main = (props) => {

    const onSubmit = (event) => {
        event.preventDefault();
        const params = new URLSearchParams();
        params.append("token", props.state.token);
        params.append("device", "Web");
        props.main(params);
      };


    return (
        <div>
            <form onSubmit={onSubmit}>
                <button type="submit">probar main</button>
            </form>
            <Videos videoData={props.state.contents} favs={props.state.user.favs}/>
            <pre>{JSON.stringify(props, null, 2)}</pre>
        </div>
    )
}

const mapStateToProps = (state) => ({ state: state });

const mapDispatchToProps = (dispatch) => ({
    main: (params) => {
    ApiRequest.App.Main(params)(dispatch);
  },
});

const connectedMain = connect(
  mapStateToProps,
  mapDispatchToProps
)(Main);

export default connectedMain;
